function checkDuplicateData(patientId, eventType, eventDate) {
	var query = "SELECT Id FROM Encounters WHERE PatientId='" + patientId + "' AND EventType='" + eventType + "' AND EventDate='" + eventDate + "'";
     var result = selectQueryBuilder(query);
	if(result.length > 0){
		return false;
	}
	return true;
}

/**
