function getPatientId(firstName,lastName,dob,ssn) {
	var query = "SELECT PersonID FROM Person WHERE "
	if(firstName !=''){
		query += "FirstName='" + firstName + "'"
		if(lastName !=''){
				query += " AND LastName='" + lastName + "'"
		}
	}else{
		if(lastName !=''){
			query += " LastName='" + lastName + "'"
		}
	}
	if(dob !=''){
		query += " AND DateOfBirth='" + dob + "'"
	}
	ssn = ssn.replace("-","");
	ssn = ssn.replace("-","");
	if(ssn !=''){
		query = "SELECT PersonID FROM Person WHERE "
		query += "SSN='" + ssn + "'";
	}
     var result = selectQueryBuilder(query);
	return result;
}

