/**
	Modify the description here. Modify the function name and parameters as needed. One function per
	template is recommended; create a new code template for each new function.

	@param {String} arg1 - arg1 description
	@return {String} return description
*/
function insertQueryBuilder(data,database) {
	var env = JSON.parse(configurationMap.get("settings"));
    var dbConn = DatabaseConnectionFactory.createDatabaseConnection('net.sourceforge.jtds.jdbc.Driver', env.Databases.default.connectionstring, env.Databases.default.user, env.Databases.default.password); 
    try {
	var query = "";
	var queryHead = "INSERT INTO ";
		queryHead += database;
		queryHead += " (";
	var queryValue = ") VALUES ("
	var count = (Object.keys(data).length);
	var i=0;
	for (var key in data) {
		if (data.hasOwnProperty(key)) {
			i++  
			if (i < count){
				queryHead += key + ", "
				queryValue +="'" + data[key] + "', ";
			}else{
				queryHead += key;
				queryValue +="'" + data[key] + "'"
			}			     		
        	}
	}
	queryValue += ")";
	query = queryHead + queryValue;
	//logger.debug(query + " - Count:" + count);
	result = dbConn.executeUpdate(query);
         dbConn.close();
    } finally {
        if (dbConn) {
            dbConn.close();
        }
    }
}

/**
	Modify the description here. Modify the function name and parameters as needed. One function per
	template is recommended; create a new code template for each new function.

	@param {String} arg1 - arg1 description
	@return {String} return description
*/
function selectQueryBuilder(query) {
    try {

        var env = JSON.parse(configurationMap.get("settings"));
        var dbConn = DatabaseConnectionFactory.createDatabaseConnection('net.sourceforge.jtds.jdbc.Driver', env.Databases.default.connectionstring, env.Databases.default.user, env.Databases.default.password);
        try {
        var result = dbConn.executeCachedQuery(query);
        var rsmd = result.getMetaData();
        result.next();
        var values = [];
        var count = rsmd.getColumnCount() + 1;
        var field = {};
            for (var j = 1; j < count; ++j) {
                var colomn = rsmd.getColumnName(j).toString();

                field[colomn] = result.getString(colomn);
                values.push(field);

            }      
          return values;
        } catch (ex) {
            return [];           
        }

    } finally {
        if (dbConn) {
            dbConn.close();
        }

    }
}

